import React, { Component } from 'react';



class Publicity extends Component {



    render() {
        return (
            <React.Fragment>
                <div className="container bg-success">
                      <img className="card-img-top" src="/materialPublicitario.jpg" alt="fotoPerfil"  />                  
                </div>
            </React.Fragment>
        );
    }
}


export default Publicity;
